import { css } from "@emotion/react";

export const styles = {
  table: css`
    margin-top: 2rem;
    width: 100%;

    -webkit-box-shadow: 0px 10px 13px -1px rgba(0, 0, 0, 0.75);
    -moz-box-shadow: 0px 10px 13px -1px rgba(0, 0, 0, 0.75);
    box-shadow: 0px 10px 13px -1px rgba(0, 0, 0, 0.75);
  `,
};
